(56, 'Job Sector/slider', 'Equator International', 'Publish', 1, 'Job Sector/slider', 'Job Sectors', '', '', '', 'Featured Jobs', '', '', 'slider/background_tk5DfSJ.webp', '', 'background/featurejobs-bg_6qT69bO.webp', 54, '', '', 'None'),
(57, 'Job sector', '', 'Publish', 2, 'Group', '', '', '', '', '', '', '', '', '', '', 54, '', '', NULL),
(58, 'About Us', 'Equator International', 'Publish', 1, 'AboutUs', 'About Company', '<div class=\"text-gray-700 sm:text-base text-sm w-full aos-init aos-animate\" data-aos=\"fade-right\" data-aos-duration=\"1000\" data-aos-once=\"true\"><p class=\"mb-2\">To\r\n begin with,we would like to introduce Equator International Pvt.Ltd \r\nasone of the prominent and well-known Manpower Recruiting Agency in \r\nNepal. With honesty and reliablity as the key objectives, this \r\norganization,being a service based agency has constantly emphasized on \r\nquality services to ensure utmost satisfaction to both its clients as \r\nwell as to the aspirants seeking overseas employment. That is not \r\nall,This organization has left no stone unturned to functionas a bridge \r\nbetween the employer and the employee to ensure smooth relationship \r\nbetween them thus avoiding any sort of misunderstandings.</p><p>Maintain\r\n a smooth relationship with our clients and job seekers is what we \r\nbelive in.Since we also beloive in understanding, sincerity and \r\nreliability we commit hasslein.Since we also belive in \r\nunderstanding,sincerity and reliability we commit hassle free service to\r\n our business partners and clients to puhold charming relationship. In \r\nthis regard,we,the entire team of Equator International Pvt Ltd urge all\r\n concerned parties and clients to provide us an opportunity to establish\r\n a smooth business relationship to prove our commitment.</p></div><p></p>', '<div class=\"text-gray-700 bg-gray-100 p-3 aos-init aos-animate\" data-aos=\"fade-right\" data-aos-duration=\"1000\" data-aos-once=\"true\"><ul class=\"sm:text-base text-sm\"><li class=\"flex items-center gap-2\"><i class=\"fa-solid fa-check\"></i><p>To Highly-skilled, Skilled, Semi-skilled as well as Non-skilled people abroad.</p></li><li class=\"flex items-center gap-2\"><i class=\"fa-solid fa-check\"></i><p>To find the right candidate according to the requirement of the employer company</p></li><li class=\"flex items-center gap-2\"><i class=\"fa-solid fa-check\"></i><p>To find right job abroad according to capability of jobseekers.</p></li><li class=\"flex items-center gap-2\"><i class=\"fa-solid fa-check\"></i><p>To support the national economy by incresing foreign remittance.</p></li><li class=\"flex items-center gap-2\"><i class=\"fa-solid fa-check\"></i><p>To extend good relationship with the recruiting company abroad by providing them manpower as per their recriutment</p></li></ul></div><p></p>', 'banner/md_ahH0skf.jpg', 'Our Objective', '', '', 'slider/background_7O8QNdl.webp', '', '', 55, '', '', 'None'),
(59, 'About Nepal', '', 'Publish', 2, 'Group', '', '', '', '', '', '', '', '', '', '', 55, '', '', 'None'),
(60, 'About Nepal', 'Equator International', 'Publish', 1, 'About Nepal', '', '<div class=\"text-gray-700 sm:text-base text-sm w-full aos-init aos-animate\" data-aos=\"fade-right\" data-aos-duration=\"1000\" data-aos-once=\"true\"><p><b class=\"text-black sm:text-xl text-lg\">Nepal</b>,\r\n nestled in South Asia between the Himalayas and the Gangetic plains, is\r\n a captivating land of diverse geography and rich cultural heritage. Its\r\n breathtaking landscapes range from the soaring peaks of the Himalayas, \r\nincluding Mount Everest, to the fertile Terai plains in the south.</p><p class=\"py-1\">The\r\n capital city, Kathmandu, is a vibrant hub of ancient temples, palaces, \r\nand traditional architecture. UNESCO World Heritage Sites like Durbar \r\nSquare, Pashupatinath Temple, Swayambhunath Stupa, and Boudhanath Stupa \r\nshowcase the country\'s historical and religious significance.</p><p>Nepal\r\n is renowned as a trekker\'s paradise, with famous routes like the \r\nAnnapurna Circuit and Everest Base Camp attracting adventurers from \r\naround the world. The country\'s national parks, such as Chitwan and \r\nSagarmatha, offer opportunities to witness diverse wildlife, including \r\ntigers, rhinoceros, elephants, and rare bird species.</p><p class=\"py-1\">Despite\r\n its natural and cultural riches, Nepal faces challenges such as \r\npolitical transitions, earthquakes, and economic development. However, \r\nthe resilience and determination of the Nepalese people shine through, \r\nmaking Nepal an enchanting destination that offers not only stunning \r\nlandscapes and historical wonders but also a deep sense of spirituality \r\nand warm hospitality to all who visit.</p></div><p></p>', '', '', '', '', '', 'slider/background_v4v5RR1.webp', '', '', 59, '', '', 'None'),
